15CM188 & 15CM299 - Defendant Jesse I Hurtado in court with attorney Jaclyn R. Shelton.  Yolanda J. Tienstra appeared for the State of Wisconsin. Victim rights compliance. Initial held on 15CM299; Probable cause found, Not guilty plea entered for Initial purposes. Court reviews rights, charges and penalties. Court amends complaint in 15CM188 to correct that enhancer can add 6 months, not 9. Def enters NC plea to Ct 1 15CM188. Court accepts plea and finds guilty of 15CM188 as charged; 15CM299 is DRI. ADA Tienstra heard. Atty Shelton heard. Court heard and imposes sentence:

90 days DCJ w/h&t consecutive comm on/before 11/2/15;
Costs w/in 60 days on payment plan at rate of $25/mo comm 11/15/15 and 15th of each month until paid;
Failure to pay = 10 days DCJ w/h&t consecutive
